eval("module.exports = \"<div class=\\\"container-fluid d-flex flex-column\\\">\\n  <div class=\\\"div justify-content-center\\\">\\n    <div class=\\\"col-12 align-self-center\\\">\\n      <h3 class=\\\"title\\\">About the Assessment</h3>\\n\\n      <div class=\\\"container text-left\\\">\\n      <div class=\\\"col\\\" id=\\\"about-nav-holder\\\"></div>\\n        <!--Content for tabs-->\\n        <div class=\\\"row h-100 flex-fill map-row\\\" ref=\\\"tab-about-nav-glossary\\\" id=\\\"tab-about-nav-glossary\\\">\\n          <div class=\\\"\\\" id=\\\"glossary-holder\\\">\\n            <div class=\\\"container\\\">\\n              <div class=\\\"row justify-content-left\\\">\\n                <div class=\\\"col-3\\\">Term</div>\\n                <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\">Definition</div>\\n                  <div class=\\\"col-3\\\"><h6>Adaptation</h6></div>\\n                  <div class =\\\"col-6 offset-3 col-md-9 offset-md-0 \\\"><h6>The process of adjusting to new (climate) conditions in order to reduce risks to valued assets. <div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Adaptive Capacity</h6></div>\\n                  <div class =\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>The ability of a person, asset, or system to adjust to a hazard, take advantage of new opprtunities, or cope with change.<div>&nbsp</div> </h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Assets</h6></div>\\n                  <div class =\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>People, resources, ecosystems, infastructure, and the services they provide. Assets are the tangible and intangible things people or communities value.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Climate Stressor</h6></div>\\n                  <div class =\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>A condition, event, or trend related to climate variability and change that can exacerbate hazards.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Consequence</h6></div>\\n                  <div class =\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>A subsequent result (usually negative) that follows from damage to or loss of an asset. Quantifying potential consequences is an important part of determining risk.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Ecosystem Services</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>Benefits that humans receive from natural systems.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Exposure</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>The presence of people, assets, and ecosystems in places where they could be adversely affected by hazards.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Hazard</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>An event or condition that may cause injury, illness, or death to people or damage to assets<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Impacts</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>Effects on natural and human systems that result from hazards. Evaluating potential impacts is a critical step in assessing vulnerability.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Mitigation</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>Processes that can reduce the amount and speed of future climate change by reducing emissions of heat-trapping gases or removing them from the atmosphere.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Non-climate Stessor</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>A change or trend unrelated to climate that can exacerbate hazards.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Probability</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>The likelihood of hazard events occurring. Probabilities have traditionally been determined from the historic frequency of events. With changing climate and the introduction of non-climate stressors, the probability of hazard events also changes.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Projections</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>Potential future climate conditions calculated by computer-based models of the Earth system. Projections are based on sets of assumptions about the future (scenarios) that may or may not be realized.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Resilience</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>The capacity of a community, business, or natural environment to prevent, withstand, respond to, and recover from a disruption.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Risk</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>The potential total cost if something of value is damaged or lost, considered together with the likelihood of that loss occurring. Risk is often evaluated as the probability of a hazard occurring multiplied by the consequence that would result if it did happen.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Sensitivity</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>The degree to which a system, population, or resource is or might be affected by hazards.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Uncertainty</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>A state of incomplete knowledge. Uncertainty about future climate arises from the complexity of the climate system and the ability of models to represent it, as well as the inability to predict the decisions that society will make.<div>&nbsp</div></h6></div>\\n                  <div class=\\\"col-3\\\"><h6>Vulnerability</h6></div>\\n                  <div class=\\\"col-6 offset-3 col-md-9 offset-md-0\\\"><h6>The propensity or predisposition of assets to be adversely affected by hazards. Vulnerability encompasses exposure, sensitivity, potential impacts, and adaptive capacity.</h6></div>\\n              </div>\\n          </div>\\n        </div>\\n      </div>\\n\\n        <div class=\\\"row h-100 flex-fill map-row d-none\\\" ref=\\\"tab-about-nav-exposure\\\" id=\\\"tab-about-nav-exposure\\\">\\n          <div class=\\\"\\\" id=\\\"exposure-holder\\\">\\n            <div class=\\\"container\\\">\\n              <div class=\\\"row justify-content-left\\\">\\n                <div>\\n                  <h6>Content Holder</h6>\\n                </div>\\n              </div>\\n            </div>\\n          </div>\\n        </div>\\n\\n        <div class=\\\"row h-100 flex-fill map-row col-12 d-none\\\" ref=\\\"tab-about-nav-examples\\\" id=\\\"tab-about-nav-examples\\\">\\n            <div class=\\\"\\\" id=\\\"example-holder\\\">\\n              <!-- <div class=\\\"container\\\">\\n                <div class=\\\"row justify-content-left\\\"> -->\\n              CONTENT HOLDER\\n                <!-- </div>\\n              </div> -->\\n            </div>\\n          </div>\\n          <!-- End of container -->\\n        </div>\\n      </div>\\n    </div>\\n  </div>\\n\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/templates/about.html\n");

